import React, {useState} from 'react';

export default function Click() {
 const [count, setCount] = useState(['...']);
 const handleClick = function() {
    let arr = new Array[9];
    arr.push(Math.floor(Math.random() * 11))
    setCount(arr);
 }

 return (
  <button onClick={handleClick}>{count}</button>    
 );

}
